import MainDescription from "./main_description";
import MainServices from "./main_services";
import MainContact from "./main_contact";

const Main = () => {
	return (
		<div>
			<div className='mt-5'>
				<MainDescription
					data-aos='fade-zoom-in'
					data-aos-offset='200'
					data-aos-easing='ease-in-sine'
					data-aos-duration='600'
				></MainDescription>
				<MainServices
					data-aos='fade-zoom-in'
					data-aos-offset='200'
					data-aos-easing='ease-in-sine'
					data-aos-duration='600'
				></MainServices>
				<MainContact
					data-aos='fade-zoom-in'
					data-aos-offset='200'
					data-aos-easing='ease-in-sine'
					data-aos-duration='600'
				></MainContact>
			</div>
		</div>
	);
};

export default Main;
